  `title` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `field_body` text COLLATE utf8_unicode_ci,
  `field_foodDescription` text COLLATE utf8_unicode_ci,
  `field_foodPrice` decimal(12,2) unsigned DEFAULT '0.00',
  `field_basicText` text COLLATE utf8_unicode_ci,
  `field_specialDescription` text COLLATE utf8_unicode_ci,
  `field_specialLightSwitch` tinyint(1) unsigned NOT NULL DEFAULT '0',
  `field_hours` text COLLATE utf8_unicode_ci,
  `field_email` text COLLATE utf8_unicode_ci,
  `field_phoneNumber` text COLLATE utf8_unicode_ci,
  `field_reservationInfo` text COLLATE utf8_unicode_ci,
  `field_privateParty` text COLLATE utf8_unicode_ci,
  `field_teamMemberName` text COLLATE utf8_unicode_ci,
  `field_teamMemberBio` text COLLATE utf8_unicode_ci,
  `field_aboutForHomepage` text COLLATE utf8_unicode_ci,
  `field_currentLightswitch` tinyint(1) unsigned NOT NULL DEFAULT '0',
  `field_interactiveMap` text COLLATE utf8_unicode_ci,
  `dateCreated` datetime NOT NULL,
  `dateUpdated` datetime NOT NULL,
  `uid` char(36) COLLATE utf8_unicode_ci NOT NULL DEFAULT '0',
